package in.test.programs;

public class NumberPrintProgram {

	/**
	 * TO print below image4<br/>
	 * <img src=
	 * "data:image/jpeg;base64,"/>
	 **/
	public static void numberPrintFunc(int length) {
		int increment = 1;
		for (int i = 1; i <= length; i++) {
			for (int j = 1; j <= i; j++) {
				System.out.print(increment + " ");
				increment++;
			}
			System.out.println("");
		}

	}

	/**
	 * To print below Number Image 2. <br/>
	 * <img src=
	 * "data:image/jpeg;base64,"
	 * />
	 **/
	public static void numberPrintFunct(int length) {

		for (int i = 1; i <= length; i++) {
			for (int j = 1; j <= i; j++) {
				System.out.print(j + " ");
			}
			System.out.println("");
		}
	}

	
}
